import React, { Component } from 'react'

export default class Order extends Component {
    render() {
        return (
            <div>
                   <div className='container mt-5'>
                          <h3 className='text-center'>Order Food Online In Your Area</h3>
                          {/* <i class="material-icons sty">add_location</i> */}
                          <h6 className='text-center mt-4'><span className='text-warning'><i class="material-icons ulta mr-2">edit_location</i>New York</span>&nbsp;Change Location</h6>
                         {/* // <div className='bti mb-2'> */}
                               <form className='form-inline incenter'>
                                    <input type='text' placeholder='Enter Your Location' className='form-control wid '/>
                                    <button className='btn btn-warning '>Search</button>
                               </form>
                               
                               
                          {/* //</div> */}
                         {/* // <div className='btp mb-4'> */}
                           
                               
                         {/* // </div> */}
                          
                          
                   </div>
            </div>
        )
    }
}
